import React from 'react';
import { useState } from 'react';
import {
    GridItemContainer,
    ContentContainer,
    GridText,
    GridImg
} from './GridItemElements';
import { Link } from 'react-router-dom';

const GridItemWLogo = ({ id, itemText, itemSVG, itemLink }) => {

    return (
        <>
            <GridItemContainer id={id} onClick={window.open({ itemLink }, "_blank")}>
                <ContentContainer>
                    <GridText>{itemText}</GridText>
                    <GridImg src={itemSVG} />
                </ContentContainer>
            </GridItemContainer>
            <Link to="https://google.com">Homepage</Link>
        </>
    )
}

export default GridItemWLogo;
